import React from 'react';
import Navbar from './Navbar';
const Home=()=>{
    return(
        <>
            <h1><center>V  I  S  A  L</center></h1>
            <pre><center>Algorithm visualization platform</center></pre>
            <div className='footer'>
            <footer className="d-flex footer-dark flex-wrap justify-content-between align-items-center py-3 my-4 border-top">
                <div className="col-md-4 d-flex align-items-center">
                <a href="/" className="mb-3 me-2 mb-md-0 text-muted text-decoration-none lh-1">
                    <svg className="bi" width="30" height="24"><use href="#bootstrap"/></svg>
                </a>
                <span className="text-muted">&copy; 2021 Company, Inc</span>
                </div>

                <ul className="nav col-md-4 justify-content-end list-unstyled d-flex">
                <li className="ms-3"><a class="text-muted" href="#"><svg class="bi" width="24" height="24"><use href="#twitter"/></svg></a></li>
                <i className="bi bi-instagram"></i>
                <li class="ms-3"><a class="text-muted" href="#"><svg class="bi" width="24" height="24"><use href="#facebook"/></svg></a></li>
                </ul>
            </footer>

            </div>
        </>
    );
}
export default Home;
